import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  class Toggle extends React.Component {
    constructor(props){
      super(props);
      this.state = {  Toglu : true};
      this.handlemarbo = this.handlemarbo.bind(this);
    }

    handlemarbo(){
      this.setState( state => ({
        Toglu : !state.Toglu
      }))
    }

    render(){
      return (
        <button onClick = {this.handlemarbo}>
          {this.state.Toglu?'ON':'OFF'}
        </button>
      );
    }
  }

  return <Toggle />
  // setInterval(tick, 1000);
}

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
